import classes from './Section2.module.css';
function Section2(){
    return (
      <section>
          <div className={classes.Section2InnerContainr}>
              <div className={classes.Section2ImageBox}>
                  <img src="../rec/img1.jfif" alt="image 1"/>
              </div>
              <div className={classes.Sectio2ContentBox}></div>
          </div>
      </section>  
    );
}
export default Section2;
